// For each element in wendys_locations, add a <option> to the <select> element #wendysLocation
window.addEventListener("load", function () {
    const select = document.querySelector('#wendysLocation');
    while (wendys_locations.length > 0) {
        // Choose a random index from wendys_locations
        const randomIndex = Math.floor(Math.random() * wendys_locations.length);
        const randomLocation = wendys_locations[randomIndex];
        // Remove the location from the array
        wendys_locations.splice(randomIndex, 1);
        // Add the location to the select element
        const city = randomLocation.city, state = randomLocation.state;
        const option = document.createElement('option');
        option.text = `${city}, ${state}`;
        option.value = `${city}, ${state}`;
        select.appendChild(option); 
    }
});